import React from 'react';
import {StoreSelector, ClientSelector} from './MenuSelector';
import {Socket} from './connector';
import { connect } from 'react-redux';
import {updateCustomers} from '../actions';

const App = ({addresses,names}) => {
	return (
		<div id="App">
			<StoreSelector items={['aaa'],names}/>
			<ClientSelector items={['aaa'], addresses}/>
		</div>
	);
}

const mapStateToProps = (state) => ({
	names: state.customers.names
});

const mapDispatchToProps = (dispatch) => ({
  updateCustomers: (names) => dispatch(updateCustomers(names)),	
});
export default connect(
  mapStateToProps,
  mapDispatchToProps
)(App);
